            dist2 = ((camera_position - star2_x) ** 2 + (0 - star2_y) ** 2) ** 0.5
            if dist1 <= 10000 and dist2 <= 10000:
                if unique_check and star1_name == star2_name:
                    continue
                pairs.append((star1_name, star2_name))
    return pairs

